import React from "react";
import "./ProductActions.css";

const ProductActions = () => {
  return (
    <div className="product-actions">
      <button className="product-actions__add-to-cart">Add to Cart</button>
      <button className="product-actions__buy-now">Buy Now</button>
    </div>
  );
};

export default ProductActions;
